import React from 'react'
import "bootstrap/dist/css/bootstrap.min.css"
import Bg_carusel from '../../Components/blog/bg_carusel';
import Themen from '../../Components/blog/themen';
import Hck_txt from '../../Components/blog/hck_txt';


export default function Ethical_hacking() {
  return (
    <>
        <div style={{position: "absolute", height: '6', top: "0px", width: "100%", zIndex: "-2"}}>
            <Bg_carusel />
        </div>

        <div style={{ width: "100%", display: "flex", justifyContent: "center", marginTop: "calc(100vh / 1.5)", zIndex: "10"}}>
            <div className='z-index-3 position-absolute w-80' style={{height: "100%"}}>
                <Themen />
                <Hck_txt />
            </div>
        </div>
    </>
  )
}
